import React from 'react';
import './Trip.css';
import TripContentPreview from './TripPreviewContent';
// import { Link } from 'react-router-dom';

export default function TripFull() {
  return (
    <div className="trip-full">
      <TripContentPreview />

      <div className="trip-full__flight-details">
        <p>Flight: BA 2764</p>
        <p>Class economy</p>
        <p>Footprint: 110 kg CO2</p>
      </div>

      <div className="trip-full__luggage trip-full__luggage--carry-on">
        <p>Carry-on luggage goal:</p>
        <p>below 15 kg</p>
        <div className="trip-full__luggage__goal-container">
            <div className="trip-full__luggage__goal-bar"></div>
            <p>0kg</p>
            <p>23kg</p>
        </div>
      </div>

    <Link to="/edit-trip" className="my-trip__button--edit-trip button-grey"><PencilIcon /></Link>

    </div>
  )
}
